import React from "react";
import Card from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import "./index.css";

const Profile = () => {
  return (
    <div className="mx-auto my-4 center">
      <h2 className="my-2">Profile</h2>
      <Card className="p-3">
        <Container>
          <Row>
            <Col lg={4}></Col>
            <Col lg={4}>
              Name <br />
              Date of Birth <br />
              Gender <br />
              Race <br />
              Religion <br />
              School ID <br />
              Class <br />
            </Col>
            <Col lg={4}>
              Name <br />
              Date of Birth <br />
              Gender <br />
              Race <br />
              Religion <br />
              School ID <br />
              Class <br />
            </Col>
          </Row>
        </Container>
      </Card>
    </div>
  );
};

export default Profile;
